import React from 'react';
import { Header, Icon, Image, Menu, Segment, Sidebar } from 'semantic-ui-react';

class Sidenav extends React.Component {
  render() {
    return (
      <Sidebar.Pushable as={Segment}>
        <Sidebar
          as={Menu}
          animation='overlay'
          icon='labeled'
        ></Sidebar>
      </Sidebar.Pushable>
    )
  }
}

export default Sidenav;
